import { axios } from "./axios";
import {AxiosResponse} from "axios";

export async function sendMessage(param : any)  {
     let response : Promise<AxiosResponse<any>> ;
     try {
          response = axios.post('',param);
     }catch(err){
          console.log(err);
     }finally {
          console.log(response);
     }
}
